$(function(){obj={admin_login:function(){var n=$("#admin_pass").val();n.length<1?layer.msg(ADLoginPHP.Input_Login_Password,{icon:2,time:1200,anim:6}):$.ajax({type:"POST",url:ADLoginPHP.LoginAdmin,dataType:"json",data:{password:n},beforeSend:function(){$.messager.progress({title:StrackLang.Waiting,msg:StrackLang.loading})},success:function(n){$.messager.progress("close"),200===parseInt(n.status)?window.location.reload():layer.msg(n.message,{icon:7,time:1200,anim:6})}})}},Strack.delete_storage("admin_menu_top"),$(document).keydown(function(n){13===n.keyCode&&(n.preventDefault(),obj.admin_login())})});